import React from 'react';
import H_SData from './H&SData';
import Card from './Card';
import { useState } from 'react';
 

const Hide_Show=()=>{

    let [getData,update]=useState(H_SData);

    return(

        <>
        
         {getData.map((val)=>{
             const [id,Ans,Que]= val;
             return(
                 <Card 
                     key={id}
                     Ans={Ans}
                     Que={Que}
                 />
             )
         }) } 
        </>
    )
}

export default Hide_Show;
